import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';

export const Navbar = () => {
  return (
    // <div className='px-5 z-50 py-[.8rem] bg-red-500 lg:px-20 flex justify-between items-center' style={{ backgroundColor: '#FE9FDA' }}>

