          <Avatar sx={{bgcolor:"white", color:"#FE9FDA"}}>

          </Avatar>
        </div>

        <div className=''>
          <IconButton>
            <ShoppingCartIcon sx={{fontSize:"1.5rem"}}/>
          </IconButton>
        </div>
      </div>
    //</div>
  );
};
